    <div className='card'>
      <img src={desktopImg} alt='' />
      <div className='text'>
        <h1>{title}</h1>
        <p>{description}</p>
        <div className='buttons'>
          <button>Code</button>
          <button>Live</button>
        </div>
      </div>
    </div>
  );
}

export default Project;
